import React from 'react';
import { motion } from 'framer-motion';
import { User, Award, MapPin, Mail, Phone, Linkedin, Github } from 'lucide-react';
import './About.css';

const About = () => {
  const personalInfo = [
    { icon: <User size={20} />, label: 'Name', value: 'Shashank Hegde' },
    { icon: <Award size={20} />, label: 'Title', value: 'Research Scientist' },
    { icon: <MapPin size={20} />, label: 'Location', value: '[Your City, Country]' },
    { icon: <Mail size={20} />, label: 'Email', value: 'shashankhegde1998@gmail.com ' },
    { icon: <Phone size={20} />, label: 'Phone', value: '+1 (555) 123-4567' }
  ];

  const socialLinks = [
    { icon: <Linkedin size={20} />, label: 'LinkedIn', url: 'https://linkedin.com/in/yourprofile' },
    { icon: <Github size={20} />, label: 'GitHub', url: 'https://github.com/yourusername' }
  ];

  return (
    <section className="about section" id="about">
      <div className="container">
        <motion.div
          initial={{ opacity: 0, y: 50 }}
          whileInView={{ opacity: 1, y: 0 }}
          transition={{ duration: 0.8 }}
          viewport={{ once: true }}
        >
          <h2 className="section-title">About Me</h2>
          <p className="section-subtitle">
            Get to know me better - my background, expertise, and professional journey
          </p>
        </motion.div>

        <div className="about-content">
          <motion.div 
            className="about-text"
            initial={{ opacity: 0, x: -50 }}
            whileInView={{ opacity: 1, x: 0 }}
            transition={{ duration: 0.8, delay: 0.2 }}
            viewport={{ once: true }}
          >
            <h3>Professional Overview</h3>
            <p>
              I am a dedicated research scientist with over [X] years of experience in [Your Field]. 
              My research focuses on [specific research areas], where I have contributed to 
              numerous publications and collaborative projects.
            </p>
            <p>
              Currently, I work as [Your Current Position] at [Your Institution], where I lead 
              research initiatives and mentor graduate students. My work has been recognized 
              through various awards and grants, including [specific awards/grants].
            </p>
            <p>
              I am passionate about [specific interests or goals], and I believe in the power 
              of collaborative research to address complex challenges in [your field].
            </p>
          </motion.div>

          <motion.div 
            className="about-details"
            initial={{ opacity: 0, x: 50 }}
            whileInView={{ opacity: 1, x: 0 }}
            transition={{ duration: 0.8, delay: 0.4 }}
            viewport={{ once: true }}
          >
            <div className="personal-info">
              <h3>Personal Information</h3>
              <div className="info-list">
                {personalInfo.map((info, index) => (
                  <div key={index} className="info-item">
                    <span className="info-icon">{info.icon}</span>
                    <div className="info-content">
                      <span className="info-label">{info.label}</span>
                      <span className="info-value">{info.value}</span>
                    </div>
                  </div>
                ))}
              </div>
            </div>

            <div className="social-links">
              <h3>Connect With Me</h3>
              <div className="social-list">
                {socialLinks.map((social, index) => (
                  <a 
                    key={index} 
                    href={social.url} 
                    target="_blank" 
                    rel="noopener noreferrer"
                    className="social-link"
                  >
                    {social.icon}
                    <span>{social.label}</span>
                  </a>
                ))}
              </div>
            </div>
          </motion.div>
        </div>
      </div>
    </section>
  );
};

export default About;
